import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse(`{"title":"§ 38.2-3919 Agents' licenses required.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-3919.md","filePath":"vacode/38.2-3919.md"}`),r={name:"vacode/38.2-3919.md"},n=t('<h1 id="§-38-2-3919-agents-licenses-required" tabindex="-1">§ 38.2-3919 Agents&#39; licenses required. <a class="header-anchor" href="#§-38-2-3919-agents-licenses-required" aria-label="Permalink to &quot;§ 38.2-3919 Agents&#39; licenses required.&quot;">​</a></h1><p>A. Except as provided in subsection B, each individual who is a resident of this Commonwealth who desires to obtain a license to sell, solicit, or negotiate any of the classes of insurance specified in § <a href="http://law.lis.virginia.gov/vacode/38.2-3902/" target="_blank" rel="noreferrer">38.2-3902</a> shall obtain that license only when that individual has passed a written examination prescribed by the Commission.</p><p>B. Any individual who is licensed prior to July 1, 1990, and whose license is restricted to the classes of insurance specified in Category A of § <a href="http://law.lis.virginia.gov/vacode/38.2-3902/" target="_blank" rel="noreferrer">38.2-3902</a> shall be exempted from the written examination provision noted above.</p><p>C. Business entities, as defined in § <a href="http://law.lis.virginia.gov/vacode/38.2-1800/" target="_blank" rel="noreferrer">38.2-1800</a>, whether resident or nonresident, as well as nonresident individuals who desire to obtain a license to sell, solicit, or negotiate any of the classes of insurance specified in § <a href="http://law.lis.virginia.gov/vacode/38.2-3902/" target="_blank" rel="noreferrer">38.2-3902</a> shall be eligible for licensing upon satisfaction of the requirements set forth in § <a href="http://law.lis.virginia.gov/vacode/38.2-1836/" target="_blank" rel="noreferrer">38.2-1836</a>.</p><p>1985, c. 400, § 38.1-549.20; 1986, c. 562; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0706" target="_blank" rel="noreferrer">706</a>.</p>',5),s=[n];function o(l,c,d,h,f,p){return i(),a("div",null,s)}const v=e(r,[["render",o]]);export{g as __pageData,v as default};
